script: |
  super -f text -I q4596.spq | sort > q4596.out

inputs:
  - name: q4596.spq
    data: |
      SELECT - col1 + col0 / - col1 - col1 + + 85 AS col1, CAST ( NULL AS INTEGER ) + - - 52 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 17 * - 76 IS NOT NULL;
  - name: tab2

outputs:
  - name: q4596.out
    data: |
